        log('containers:match invokeAction result', res);
      })
      .catch((err) => {
        log('containers:match invokeAction error', err);
      });
  }
}

async function checkHealth() {
  // log('health check >>>'); /* Don't log every health check */
  try {
    const res = await window.api!.health();
    // log('health result', res);  /* Don't log successful health results */
    if (res.ok) {
      if (healthEl) healthEl.textContent = ' ';
      setStatus('', true);
      
      // Stop health checks if healthy
      if (!isHealthy) {
        isHealthy = true;
        if (healthInterval) {
          clearInterval(healthInterval);
          healthInterval = null;
          log('Health checks stopped after successful check');
        }
      }
    } else {
      if (healthEl) healthEl.textContent = ' ';
      setStatus('', false);
      isHealthy = false;
    }
  } catch (e) {
    log('health error', e);
    if (healthEl) healthEl.textContent = ' ';
    setStatus('', false);
    isHealthy = false;
  }
}

log('ui init complete');
checkHealth();
healthInterval = setInterval(checkHealth, 5000);

const btnMinimize = document.getElementById('btnMinimize') as HTMLButtonElement;
const btnClose = document.getElementById('btnClose') as HTMLButtonElement;

btnHealth?.addEventListener('click', checkHealth);
btnClear?.addEventListener('click', () => {
  if (eventsEl) eventsEl.innerHTML = '';
});

if (btnMinimize && window.api) {
  btnMinimize.addEventListener('click', () => {
    window.api.invokeAction('window:minimize', {}).catch(err => {
      console.error('Failed to minimize:', err);
    });
  });
}

if (btnClose && window.api) {
  btnClose.addEventListener('click', () => {
    window.api.invokeAction('window:close', {}).catch(err => {
      console.error('Failed to close:', err);
    });
  });
}

